import React, { useState, KeyboardEvent, useRef, useEffect } from 'react';
import './App.css';

interface Message {
    text: string;
    type: 'user' | 'reply';
}

function App() {
    const [messages, setMessages] = useState<Message[]>([]);
    const [input, setInput] = useState('');
    const [file, setFile] = useState<File | null>(null);
    const [canvas, setCanvas] = useState<string[]>([]);
    const [isLoading, setIsLoading] = useState(false);
    const messagesEndRef = useRef<HTMLDivElement>(null);

    const scrollToBottom = () => {
        messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
    };

    useEffect(() => {
        scrollToBottom();
    }, [messages]);

    const handleSend = async () => {
        if (input.trim()) {
            // Add user message
            setMessages(prev => [...prev, { text: input, type: 'user' }]);
            setIsLoading(true);

            // Simulate API delay
            await new Promise(resolve => setTimeout(resolve, 1000));

            // Simulate a response (in a real app, this would come from the backend)
            const response = `Response to: ${input}`;
            setMessages(prev => [...prev, { text: response, type: 'reply' }]);

            // Only update canvas if there's generated content
            const generatedContent = Math.random() > 0.5 ? `Generated content for: ${input}` : null;
            if (generatedContent) {
                setCanvas([...canvas, generatedContent]);
            }

            setInput('');
            setIsLoading(false);
        }
    };

    const handleKeyPress = (event: KeyboardEvent<HTMLTextAreaElement>) => {
        if (event.key === 'Enter' && !event.shiftKey) {
            event.preventDefault();
            handleSend();
        }
    };

    const handleFileChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        if (event.target.files && event.target.files[0]) {
            setFile(event.target.files[0]);
        }
    };

    const clearChat = () => {
        setMessages([]);
        setCanvas([]);
        setFile(null);
    };

    return (
        <div className="App">
            <div className="chat-layout">
                <div className="sidebar">
                    <button className="new-chat-button" onClick={clearChat}>
                        + New Chat
                    </button>
                    <div className="chat-history">
                        {/* Chat history would go here */}
                    </div>
                </div>
                <div className="main-content">
                    <div className="messages-container">
                        {messages.length === 0 ? (
                            <div className="welcome-message">
                                <h1>AgentHub Chat</h1>
                                <p>Start a conversation with the AI assistant</p>
                            </div>
                        ) : (
                            messages.map((msg, index) => (
                                <div key={index} className={`message-wrapper ${msg.type}`}>
                                    <div className="message-content">
                                        <div className="message-header">
                                            <span className="message-label">
                                                {msg.type === 'user' ? 'You' : 'Assistant'}
                                            </span>
                                        </div>
                                        <div className="message-text">{msg.text}</div>
                                    </div>
                                </div>
                            ))
                        )}
                        {isLoading && (
                            <div className="message-wrapper reply">
                                <div className="message-content">
                                    <div className="message-header">
                                        <span className="message-label">Assistant</span>
                                    </div>
                                    <div className="typing-indicator">
                                        <span></span>
                                        <span></span>
                                        <span></span>
                                    </div>
                                </div>
                            </div>
                        )}
                        <div ref={messagesEndRef} />
                    </div>
                    <div className="input-area">
                        <div className="input-container">
                            <textarea
                                value={input}
                                onChange={(e) => setInput(e.target.value)}
                                onKeyPress={handleKeyPress}
                                placeholder="Message AgentHub..."
                                rows={1}
                            />
                            <button
                                className="send-button"
                                onClick={handleSend}
                                disabled={!input.trim() || isLoading}
                            >
                                <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                                    <path d="M22 2L11 13M22 2L15 22L11 13L2 9L22 2Z" />
                                </svg>
                            </button>
                        </div>
                        <div className="input-footer">
                            <span>AgentHub can make mistakes. Consider checking important information.</span>
                        </div>
                    </div>
                </div>
                <div className="canvas-panel">
                    <h2>Canvas</h2>
                    {canvas.map((content, index) => (
                        <div key={index} className="canvas-content">{content}</div>
                    ))}
                </div>
            </div>
        </div>
    );
}

export default App;
